import E1 from './E1';

function Leituradp () {
  return (
    <Router>
      <div id="main">
        <Route path='/Exercicios/Leitura-de-partitura' exact component={Leituradp}>
          <div>
             <a href='/Leitura-de-partitura/e1' className='exerciciosNum' > Fazer o exercicio </a>
          </div>
        </Route>
        <E1 />
      </div>
    </Router>
  );
}

export default Leituradp;
